 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_6", t1."Leaf_12", t1."Leaf_17", t1."Leaf_19", t1."Leaf_20", t1."Leaf_23", t1."Leaf_24", t1."Leaf_26", t1."Leaf_27", t1."Leaf_29", t1."Leaf_30", t1."Leaf_34", t1."Leaf_35", t1."Leaf_36", t1."Leaf_37", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_42", t1."Leaf_45", t1."Leaf_47", t1."Leaf_48", t1."Leaf_49", t1."Leaf_50", t1."Leaf_53", t1."Leaf_55", t1."Leaf_56", t1."Leaf_59", t1."Leaf_61", t1."Leaf_62", t1."Leaf_63", t1."Leaf_64", t1."Leaf_65", t1."Leaf_69", t1."Leaf_74", t1."Leaf_76", t1."Leaf_78", t1."Leaf_81", t1."Leaf_82", t1."Leaf_84", t1."Leaf_85", t1."Leaf_86", t1."Leaf_89", t1."Leaf_91", t1."Leaf_95", t1."Leaf_96", t1."Leaf_99", t1."Leaf_101", t1."Leaf_102", t1."Leaf_103", t1."Leaf_105", t1."Leaf_106", t1."Leaf_107", t1."Leaf_109", t1."Leaf_110", t1."Leaf_111", t1."Leaf_115", t1."Leaf_117", t1."Leaf_118", t1."Leaf_121", t1."Leaf_122", t1."Leaf_123", t1."Leaf_125", t1."Leaf_126" ) AS node_id
