    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_21" <= 1.000000) AND (t."X_61" <= 4.500000) AND (t."X_59" > 2.500000)) THEN 6 ELSE NULL END AS "Leaf_6",
      CASE WHEN((t."X_21" <= 1.000000) AND (t."X_61" > 4.500000) AND (t."X_10" > 5.500000) AND (t."X_62" <= 6.500000) AND (t."X_12" > 8.500000)) THEN 12 ELSE NULL END AS "Leaf_12",
