   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_12" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_8", t1."Leaf_11", t1."Leaf_12", t1."Leaf_15", t1."Leaf_17", t1."Leaf_20", t1."Leaf_22", t1."Leaf_23", t1."Leaf_24", t1."Leaf_26", t1."Leaf_31", t1."Leaf_32", t1."Leaf_33", t1."Leaf_35", t1."Leaf_36", t1."Leaf_37", t1."Leaf_43", t1."Leaf_44", t1."Leaf_45", t1."Leaf_46", t1."Leaf_48", t1."Leaf_49", t1."Leaf_50", t1."Leaf_51", t1."Leaf_52", t1."Leaf_55", t1."Leaf_58", t1."Leaf_59", t1."Leaf_61", t1."Leaf_62", t1."Leaf_64", t1."Leaf_68", t1."Leaf_72", t1."Leaf_73", t1."Leaf_74", t1."Leaf_77", t1."Leaf_78", t1."Leaf_81", t1."Leaf_82", t1."Leaf_83", t1."Leaf_84", t1."Leaf_87", t1."Leaf_94", t1."Leaf_95", t1."Leaf_96", t1."Leaf_100", t1."Leaf_101", t1."Leaf_102", t1."Leaf_106", t1."Leaf_107", t1."Leaf_108", t1."Leaf_110", t1."Leaf_113", t1."Leaf_115", t1."Leaf_116", t1."Leaf_118", t1."Leaf_119", t1."Leaf_120", t1."Leaf_121", t1."Leaf_122", t1."Leaf_123", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_33" > 6.500000) AND (t."X_58" <= 1.000000) AND (t."X_62" <= 3.000000)) THEN 5 ELSE NULL END AS "Leaf_5",
      CASE WHEN((t."X_33" > 6.500000) AND (t."X_58" <= 1.000000) AND (t."X_62" > 3.000000) AND (t."X_44" > 8.500000)) THEN 8 ELSE NULL END AS "Leaf_8",
      CASE WHEN((t."X_33" > 6.500000) AND (t."X_58" <= 1.000000) AND (t."X_62" > 3.000000) AND (t."X_44" <= 8.500000) AND (t."X_34" <= 6.500000) AND (t."X_35" <= 1.000000)) THEN 11 ELSE NULL END AS "Leaf_11",
