   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_23" AS t1
   LEFT OUTER JOIN
   "DT_node_data_23" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_24" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_7", t1."Leaf_9", t1."Leaf_10", t1."Leaf_13", t1."Leaf_18", t1."Leaf_19", t1."Leaf_20", t1."Leaf_21", t1."Leaf_30", t1."Leaf_31", t1."Leaf_33", t1."Leaf_34", t1."Leaf_36", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_42", t1."Leaf_44", t1."Leaf_45", t1."Leaf_47", t1."Leaf_48", t1."Leaf_49", t1."Leaf_50", t1."Leaf_52", t1."Leaf_53", t1."Leaf_54", t1."Leaf_60", t1."Leaf_61", t1."Leaf_64", t1."Leaf_66", t1."Leaf_67", t1."Leaf_68", t1."Leaf_69", t1."Leaf_72", t1."Leaf_76", t1."Leaf_77", t1."Leaf_83", t1."Leaf_86", t1."Leaf_87", t1."Leaf_88", t1."Leaf_89", t1."Leaf_90", t1."Leaf_91", t1."Leaf_93", t1."Leaf_96", t1."Leaf_97", t1."Leaf_98", t1."Leaf_99", t1."Leaf_100", t1."Leaf_103", t1."Leaf_105", t1."Leaf_109", t1."Leaf_111", t1."Leaf_112", t1."Leaf_114", t1."Leaf_116", t1."Leaf_117", t1."Leaf_118", t1."Leaf_121", t1."Leaf_123", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_33" > 6.500000) AND (t."X_35" <= 0.500000) AND (t."X_36" <= 0.500000)) THEN 5 ELSE NULL END AS "Leaf_5",
      CASE WHEN((t."X_33" > 6.500000) AND (t."X_35" <= 0.500000) AND (t."X_36" > 0.500000) AND (t."X_3" <= 1.500000)) THEN 7 ELSE NULL END AS "Leaf_7",
      CASE WHEN((t."X_33" > 6.500000) AND (t."X_35" <= 0.500000) AND (t."X_36" > 0.500000) AND (t."X_3" > 1.500000) AND (t."X_36" <= 1.500000)) THEN 9 ELSE NULL END AS "Leaf_9",
      CASE WHEN((t."X_33" > 6.500000) AND (t."X_35" <= 0.500000) AND (t."X_36" > 0.500000) AND (t."X_3" > 1.500000) AND (t."X_36" > 1.500000)) THEN 10 ELSE NULL END AS "Leaf_10",
