"DT_Output_24" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", t2."P_4" AS "P_4", t2."P_5" AS "P_5", t2."P_6" AS "P_6", t2."P_7" AS "P_7", t2."P_8" AS "P_8", t2."P_9" AS "P_9", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_24" AS t1
   LEFT OUTER JOIN
   "DT_node_data_24" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_25" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_6", t1."Leaf_11", t1."Leaf_12", t1."Leaf_13", t1."Leaf_14", t1."Leaf_15", t1."Leaf_19", t1."Leaf_20", t1."Leaf_21", t1."Leaf_22", t1."Leaf_23", t1."Leaf_31", t1."Leaf_33", t1."Leaf_36", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_41", t1."Leaf_46", t1."Leaf_48", t1."Leaf_49", t1."Leaf_50", t1."Leaf_52", t1."Leaf_54", t1."Leaf_55", t1."Leaf_56", t1."Leaf_64", t1."Leaf_65", t1."Leaf_66", t1."Leaf_70", t1."Leaf_71", t1."Leaf_72", t1."Leaf_73", t1."Leaf_75", t1."Leaf_76", t1."Leaf_81", t1."Leaf_82", t1."Leaf_83", t1."Leaf_84", t1."Leaf_86", t1."Leaf_88", t1."Leaf_89", t1."Leaf_90", t1."Leaf_93", t1."Leaf_95", t1."Leaf_96", t1."Leaf_98", t1."Leaf_99", t1."Leaf_100", t1."Leaf_104", t1."Leaf_106", t1."Leaf_107", t1."Leaf_110", t1."Leaf_111", t1."Leaf_113", t1."Leaf_114", t1."Leaf_117", t1."Leaf_118", t1."Leaf_120", t1."Leaf_122", t1."Leaf_123", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_30" > 3.000000) AND (t."X_13" > 2.500000) AND (t."X_60" <= 1.500000)) THEN 5 ELSE NULL END AS "Leaf_5",
      CASE WHEN((t."X_30" > 3.000000) AND (t."X_13" > 2.500000) AND (t."X_60" > 1.500000)) THEN 6 ELSE NULL END AS "Leaf_6",
